import { SafeUrlPipe } from './../pipes/safe-url/safe-url.pipe';
import {
  IonHeader,
  IonToolbar,
  IonTitle,
  IonContent,
  IonLabel,
  IonButton,
  IonCard,
  IonCardHeader,
  IonCardContent,
  IonCardTitle,
  IonCol,
  IonRow,
  IonIcon,
  IonSelect,
  IonSelectOption,
  IonDatetime,
  IonPopover,
  IonInput,
  IonItem,
  IonList,
  IonTextarea,
} from '@ionic/angular/standalone';
import { Component, OnInit } from '@angular/core';
import { FormBuilder, FormGroup, FormArray } from '@angular/forms';
import { ReactiveFormsModule, FormsModule } from '@angular/forms';
import { CommonModule } from '@angular/common';

import { addIcons } from 'ionicons';
import { trash } from 'ionicons/icons';

import pdfMake from 'pdfmake/build/pdfmake'; // Default import
import * as pdfFonts from 'pdfmake/build/vfs_fonts'; // Import VFS fonts

// Assign VFS fonts safely
(pdfMake as any).vfs = pdfFonts; // Use the fonts object directly

@Component({
  selector: 'app-home',
  templateUrl: 'home.page.html',
  styleUrls: ['home.page.scss'],
  imports: [
    CommonModule,
    IonHeader,
    IonToolbar,
    IonTitle,
    IonContent,
    ReactiveFormsModule,
    IonButton,
    IonCard,
    IonCardContent,
    IonCardTitle,
    IonCardHeader,
    IonCol,
    IonRow,
    IonIcon,
    SafeUrlPipe,
    IonSelect,
    IonSelectOption,
    IonDatetime,
    IonPopover,
    FormsModule,
    IonInput,
    IonItem,
    IonList,
    IonTextarea,
  ],
})
export class HomePage {
  receiptForm!: FormGroup;
  showPreview = false;
  pdfDataUrl: string = '';
  date: any;
  total: number = 0;

  services = [
    { name: 'Plan', price: 1000 },
    { name: 'Plumbing Plan', price: 1500 },
    { name: 'Front Elevation', price: 2000 },
    { name: 'Electrical Plan', price: 1200 },
    { name: 'Blue Print', price: 1800 },
    { name: 'Estimate', price: 500 },
  ];

  constructor(private fb: FormBuilder) {
    addIcons({ trash });
  }

  ngOnInit() {
    this.receiptForm = this.fb.group({
      customerName: [''],
      customerAddress: [''],
      invoiceNumber: [''],
      date: [''],
      services: this.fb.array([this.createService()]),
    });

    this.updateTotal();
    this.servicesFormArray.valueChanges.subscribe(() => {
      this.updateTotal();
    });

    console.log(this.receiptForm.value);
  }

  updateTotal() {
    this.total = this.calculateTotal();
  }

  createService(): FormGroup {
    return this.fb.group({
      serviceSelector: [''],
      customServiceName: [''],
      price: [''],
    });
  }

  get servicesFormArray(): FormArray {
    return this.receiptForm.get('services') as FormArray;
  }

  addService() {
    this.servicesFormArray.push(this.createService());
  }

  removeService(index: number) {
    this.servicesFormArray.removeAt(index);
  }

  onServiceChange(index: number) {
    const serviceGroup = this.servicesFormArray.at(index) as FormGroup;
    const selector = serviceGroup.get('serviceSelector')?.value;
    if (selector !== 'Other') {
      const service = this.services.find((s) => s.name === selector);
      if (service) {
        serviceGroup.get('price')?.setValue(service.price);
      }
    } else {
      serviceGroup.get('customServiceName')?.setValue('');
      serviceGroup.get('price')?.setValue('');
    }
  }

  calculateTotal(): number {
    return this.servicesFormArray.controls.reduce((total, control) => {
      const price = control.get('price')?.value;
      return total + (price ? parseFloat(price) : 0);
    }, 0);
  }

  getServicesForPDF(): any[] {
    return this.servicesFormArray.controls.map((control) => {
      const selector = control.get('serviceSelector')?.value;
      const name =
        selector === 'Other'
          ? control.get('customServiceName')?.value
          : selector;
      const price = control.get('price')?.value || 0;
      return [name, price];
    });
  }

  getDocDefinition(): any {
    console.log(this.receiptForm.value);

    return {
      content: [
        {
          columns: [
            { image: 'logo', width: 100 },
            {
              text: [
                'ArchiTECH Zone,\n',
                'First floor, opposite roadways bus stand,\n',
                'tirwaganj, Kannauj\n',
                'Kannauj, Uttar pradesh - 209732 IN\n',
                'Architectural Services\n',
                '7007526236\n',
                'architechzone@gmail.com',
              ],
              alignment: 'right',
            },
          ],
        },

        {
          columns: [
            { text: 'BILL TO', style: 'subheader' },
            {
              text: `Invoice No: ${
                this.receiptForm.get('invoiceNumber')?.value || ''
              }`,
              style: 'subheader',
              alignment: 'right',
            },
          ],
        },
        {
          text: `${this.receiptForm.get('customerName')?.value || ''}\n${
            this.receiptForm.get('customerAddress')?.value || ''
          }`,
        },
        {
          columns: [
            {
              text: `Date: ${this.receiptForm.get('date')?.value || ''}`,
              alignment: 'right',
            },
          ],
        },
        {
          table: {
            headerRows: 1,
            widths: ['*', 'auto'],
            body: [
              [
                { text: 'Service', bold: true },
                { text: 'Price', bold: true },
              ],
              ...this.getServicesForPDF(),
            ],
          },
        },
        { text: `Total: ${this.calculateTotal()}`, style: 'total' },

        { text: `Terms and Conditions:`, style: 'subheader' },

        {
          text: `1. The map will not be shared via WhatsApp, print, or email before full payment is made.
          2. No changes will be accepted once the map is finalized.
          3. Maps are of various types, so the fees for each may differ.
          4. Site visit charges are separate.
          5. Visit the office to discuss the map.
          6. Call before coming to meet.
          `,
          // text: `Note:
          // 1. फुल पेमेंट होने से पहले व्हाट्सएप, प्रिंट या ईमेल नहीं किया जाएगा।
          // 2. नक्शा फाइनल (अंतिम रूप) होने के बाद कोई बदलाव स्वीकार नहीं होगा।
          // 3. नक्शे कई प्रकार के होते हैं, इसलिए सभी की फीस भी अलग-अलग होती है।
          // 4. साइट विजिट की फीस अलग से होती है।
          // 5. नक्शे पर चर्चा करने के लिए ऑफिस में आएं।
          // 6. मिलने से पहले फोन करके आएं।
          // `,
          style: 'note',
        },
      ],
      footer: {
        text: 'By signing this document, the customer agrees to the services and conditions described in this document. | archiTECHzone.com',

        alignment: 'left',
        margin: 20,
        fontSize: 8,
        link: 'https//architechzone.com',
      },
      styles: {
        subheader: { fontSize: 14, bold: true, margin: [0, 10, 0, 5] },
        total: { fontSize: 14, bold: true, margin: [0, 10, 0, 5] },
        note: { margin: [0, 10, 0, 5] },
      },
      images: {
        logo: 'data:image/png;base64,', // Placeholder
      },
    };
  }

  previewPDF() {
    const docDefinition = this.getDocDefinition();
    const pdfDoc = pdfMake.createPdf(docDefinition);
    pdfDoc.getDataUrl((dataUrl) => {
      this.pdfDataUrl = dataUrl;
      this.showPreview = true;
    });
  }

  generatePDF() {
    const docDefinition = this.getDocDefinition();
    pdfMake.createPdf(docDefinition).download('receipt.pdf');
    this.showPreview = false;
  }

  async shareWhatsApp() {
    const docDefinition = this.getDocDefinition();
    const pdfDoc = pdfMake.createPdf(docDefinition);

    pdfDoc.getBlob(async (blob) => {
      const file = new File([blob], 'receipt.pdf', { type: 'application/pdf' });
      if (navigator.share) {
        try {
          await navigator.share({
            title: 'Receipt from Architech Zone',
            text: 'Here is your receipt from Architech Zone.',
            files: [file],
          });
          console.log('Shared successfully');
        } catch (error) {
          console.error('Error sharing:', error);
          alert('Sharing failed. Please try again.');
        }
      } else {
        alert('Web Share API is not supported in your browser.');
      }
    });
  }

  closePreview() {
    this.showPreview = false;
    this.pdfDataUrl = '';
  }
}
